import React, { Component } from "react";
import Header from "./Header";
import BackgroundBlock from "./BackgroundBlock";
import Cards from "./Cards";
import LongBackgroundBlock from "./LongBackgroundBlock";
import { Link } from "react-router-dom";
import "./Education.css";

class Education extends Component {
  render() {
    return (
      <div className='Education'>
          <Header />
          <BackgroundBlock>
            <h2><a class="doc-link" href="documents/jocelyn_proctor_lwcert.png">Le Wagon Full Stack Developer 9 week Bootcamp</a></h2>
            <p>Le Wagon is a 9 week intensive full stack web development bootcamp. Every morning there is a lecture on a new topic and then exercises through out the day. Starting with Ruby basics, then diving into OOP. After there are several days dedicated to database management (SQL and Rail's Active Record). Then you dive into frontend learning the basics of CSS and HTML. Finally before projects weeks you learn how to manipulate the DOM using Javascript. After 6 weeks students group together to form teams so that they may experiance what a sprint would look like at a company with co-workers. At the end of the Camp participants will have made over 6 Rails apps.</p>
          </BackgroundBlock>
          <Header />
          <Cards />
          <Header />
          <LongBackgroundBlock />
      </div>
    );
  }
}

export default Education;
